window.bookSummaryJSON = "<p><b>The first three novels in the best-selling Phantom Queen Diaries: </b><b><i>Whiskey Ginger</i></b><b>, </b><b><i>Cosmopolitan</i></b><b>, and </b><b><i>Old Fashioned</i></b><b>.</b></p> <p>My name is Quinn MacKenna, and magic doesn’t work on me.</p> <p>When I’m not getting roped into bar brawls in Boston, I’m usually acquiring - stealing is a form of acquisition, you know - dangerous magical artifacts to turn around and sell them to the highest bidders.</p> <p>But I prefer to be paid in favors, not money. Because favors are a hot commodity in the Land of the Fae. Favors are the only currency that will buy the answers I seek: Why magic doesn’t work on me, and who my real father is.</p> <p>Everything was going so well...until I accidentally stole something from a wizard named Nate Temple in St. Louis. That’s the day my life changed forever.</p>"; 
